import * as React from "react";
import Navbars from "../Navbar/navbarHome";
import Footer from "../Footer/Footer";
import { useSelector } from "react-redux";
import { BsArrowRightShort } from "react-icons/bs";
// import Online_document from "../../Images/Online_document.png";
// import Documents from "../../Images/Documents-amico.png";
// import Translator from "../../Images/Translator-bro.png";
// import Selecting_team from "../../Images/Selecting_team.png";
import Thumbs from "../../Images/thumbs-up.png";
import Home1 from "../../Images/Home1.png";
import Accepted from "../../Images/Accepted.png";
import { useNavigate, useLocation } from "react-router-dom";
import { overviewEN, overviewTH, overviewDE } from "../Data/DataLanguage";
import { Modal, Typography, Box } from "@mui/material";

import "./Home.css";

const Home = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const auth = useSelector((state) => state.auth);
  console.log("auth :", auth);

  let Doc = location?.state?.languages;
  let Aoc = location?.state?.accept;

  const [open, setOpen] = React.useState(false);
  const [usertype, setUsertype] = React.useState("Customer");

  const handleClose = (x, y) => {
    console.log("x:", x);
    if (x === 1) {
      if (y === "English") {
        navigate("/", { state: { languages: `${y}`, accept: true } });
        setOpen(false);
      } else if (y === "Thai") {
        navigate("/", { state: { languages: `${y}`, accept: true } });
        setOpen(false);
      } else if (y === "German") {
        navigate("/", { state: { languages: `${y}`, accept: true } });
        setOpen(false);
      } else {
        navigate("/", { state: { languages: `${y}`, accept: true } });
        setOpen(false);
      }
    } else {
      navigate("/", { state: { languages: `English`, accept: false } });
      setOpen(false);
    }
  };
  const check_cookei = () => {
    if (Aoc === true) {
      setOpen(false);
    } else if (Aoc === false) {
      setOpen(false);
    } else {
      setOpen(true);
    }
  };

  React.useEffect(() => {
    check_cookei();
  });

  const goSignup = (x) => {
    navigate("/Signup", { state: { languages: `${x}` } });
  };

  const goCustomer = (x) => {
    navigate("/Home/Services/Customer", { state: { languages: `${x}` } });
  };

  const goTranslator = (x) => {
    navigate("/Home/Services/Translator", { state: { languages: `${x}` } });
  };

  return (
    <>
      <header className="App-header">
        {Doc === undefined ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>

      {/* Modal cookei*/}
      {Doc === "English" ? (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewEN[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewEN[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
              }}
            ></div>

            <div style={{ marginTop: 10, textAlign: "left", float: "left" }}>
              <button
                style={{
                  height: 40,
                  background: " #034D82",
                  borderRadius: 5,
                  color: "#FFFFFF",
                  fontWeight: 700,
                  border: "none",
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                }}
                onClick={() => handleClose(1, Doc)}
              >
                {overviewEN[9].label}
              </button>
            </div>
            <div style={{ marginTop: 10, textAlign: "right" }}>
              <button
                style={{
                  height: 40,
                  borderRadius: 5,
                  color: "#034D82",
                  fontWeight: 700,
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                  background: "#FFFFFF",
                  border: "1px solid #034D82",
                }}
                onClick={() => handleClose(2)}
              >
                {overviewEN[10].label}
              </button>
            </div>
          </Box>
        </Modal>
      ) : Doc === "Thai" ? (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewTH[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewTH[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
              }}
            ></div>

            <div style={{ marginTop: 10, textAlign: "left", float: "left" }}>
              <button
                style={{
                  height: 40,
                  background: " #034D82",
                  borderRadius: 5,
                  color: "#FFFFFF",
                  fontWeight: 700,
                  border: "none",
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                }}
                onClick={() => handleClose(1, Doc)}
              >
                {overviewTH[9].label}
              </button>
            </div>
            <div style={{ marginTop: 10, textAlign: "right" }}>
              <button
                style={{
                  height: 40,
                  borderRadius: 5,
                  color: "#034D82",
                  fontWeight: 700,
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                  background: "#FFFFFF",
                  border: "1px solid #034D82",
                }}
                onClick={() => handleClose(2)}
              >
                {overviewTH[10].label}
              </button>
            </div>
          </Box>
        </Modal>
      ) : Doc === "German" ? (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewDE[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewDE[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
              }}
            ></div>

            <div style={{ marginTop: 10, textAlign: "left", float: "left" }}>
              <button
                style={{
                  height: 40,
                  background: " #034D82",
                  borderRadius: 5,
                  color: "#FFFFFF",
                  fontWeight: 700,
                  border: "none",
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                }}
                onClick={() => handleClose(1, Doc)}
              >
                {overviewDE[9].label}
              </button>
            </div>
            <div style={{ marginTop: 10, textAlign: "right" }}>
              <button
                style={{
                  height: 40,
                  borderRadius: 5,
                  color: "#034D82",
                  fontWeight: 700,
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                  background: "#FFFFFF",
                  border: "1px solid #034D82",
                }}
                onClick={() => handleClose(2)}
              >
                {overviewDE[10].label}
              </button>
            </div>
          </Box>
        </Modal>
      ) : (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewEN[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewEN[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
              }}
            ></div>

            <div style={{ marginTop: 10, textAlign: "left", float: "left" }}>
              <button
                style={{
                  height: 40,
                  background: " #034D82",
                  borderRadius: 5,
                  color: "#FFFFFF",
                  fontWeight: 700,
                  border: "none",
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                }}
                onClick={() => handleClose(1, Doc)}
              >
                {overviewEN[9].label}
              </button>
            </div>
            <div style={{ marginTop: 10, textAlign: "right" }}>
              <button
                style={{
                  height: 40,
                  borderRadius: 5,
                  color: "#034D82",
                  fontWeight: 700,
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                  background: "#FFFFFF",
                  border: "1px solid #034D82",
                }}
                onClick={() => handleClose(2)}
              >
                {overviewEN[10].label}
              </button>
            </div>
          </Box>
        </Modal>
      )}
      <>
        <div className="fram1">
          <div className="boxBlue_overviwe">
            <p className="h_text1">Translation Hero</p>
            <p className="h_text2">Online translation platform</p>
            <div className="set_fram1_button">
              <button className="fram1_button1">Order here</button>
              <button className="fram1_button2">Subscribe</button>
            </div>

            <div className="Infram1">
              <div className="BoxInfram1">
                <div className="detileBoxInfram1">
                  <div>
                    <p className="intInfram1">95%</p>
                  </div>

                  <div className="BoxThumbs">
                    <img src={Thumbs} alt="Thumbs" className="Thumbs" />
                  </div>
                </div>
                <p className="textBoxInfram1">
                  The percentage of total active users on the site.
                </p>
              </div>
              <div className="BoxInfram1">
                <div className="detileBoxInfram1">
                  <div>
                    <p className="intInfram1">90%</p>
                  </div>

                  <div className="BoxThumbs">
                    <img src={Thumbs} alt="Thumbs" className="Thumbs" />
                  </div>
                </div>
                <p className="textBoxInfram1">
                  Employment percentage and accuracy of work.{" "}
                </p>
              </div>
              <div className="BoxInfram1">
                <div className="detileBoxInfram1">
                  <div>
                    <p className="intInfram1">100%</p>
                  </div>

                  <div className="BoxThumbs">
                    <img src={Thumbs} alt="Thumbs" className="Thumbs" />
                  </div>
                </div>
                <p className="textBoxInfram1">
                  Comprehensive and good after-sales service.{" "}
                </p>
              </div>
            </div>
          </div>
        </div>

        <div className="box2_overviwe">
          <p className="textHeading2_overviwe">USER TYPES</p>
          {usertype === "Customer" ? (
            <div className="Content">
              <button
                onClick={() => setUsertype("Customer")}
                className="Content_button1"
              >
                Customer
              </button>
              <button
                onClick={() => setUsertype("Translator")}
                className="Content_button2"
              >
                Translator
              </button>
            </div>
          ) : (
            <div className="Content">
              <button
                onClick={() => setUsertype("Customer")}
                className="Content_button2"
              >
                Customer
              </button>
              <button
                onClick={() => setUsertype("Translator")}
                className="Content_button1"
              >
                Translator
              </button>
            </div>
          )}

          <div className="Content2">
            <div className="Content2Text">
              <p>
                For customers who want to translate documents translator hero
                There is a translation system that calculates all costs.
                Including professional translators who guarantee excellent
                translation quality.
              </p>
              <button className="Content2button">Order here</button>
            </div>
            <div>
              <img src={Home1} alt="Home1" className="Home1" />
            </div>
          </div>

          <div>
            <div className="Content3text1">
              <div className="divfontContent3text1">
                <p>Why us? </p>
                <p>We can do anything for you</p>
              </div>
              <div className="divfontContent3text1_1">
                <p>
                  translate many documents Official documents with more than 50
                  forms to choose from, or general translations such as
                  articles, movies,thesis, letters, etc.
                </p>
              </div>
            </div>
            <img />
          </div>
          <div className="Content3_1"></div>
        </div>

        <div>
